import React from "react";
import { GoogleMap, useJsApiLoader } from "@react-google-maps/api";

const options = {
  zoomControlOptions: {
    position: google.maps.ControlPosition.RIGHT_CENTER, // 'right-center' ,
    // ...otherOptions
  },
};

function MyComponent() {
  const { isLoaded, loadError } = useJsApiLoader({
    googleMapsApiKey: "AIzaSyDZ4HxogFXeESTTN2JXpPpjCRozf7vEfIk", // ,
    // ...otherOptions
  });

  const renderMap = () => {
    // wrapping to a function is useful in case you want to access `window.google`
    // to eg. setup options or create latLng object, it won't be available otherwise
    // feel free to render directly if you don't need that
    const onLoad = React.useCallback(function onLoad(mapInstance) {
      // do something with map Instance
    });
    return (
      <GoogleMap options={options} onLoad={onLoad}>
        {
          // ...Your map components
        }
      </GoogleMap>
    );
  };

  if (loadError) {
    return <div>Map cannot be loaded right now, sorry.</div>;
  }

  return isLoaded ? renderMap() : <Spinner />;
}
